import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Your automation logic here
    // Use a more specific selector to find the "Shop electronics" link within the category card
    const electronicsCardLink = page.locator('.category-card:has-text("Electronics") a:has-text("Shop electronics")');

    // Wait for the element to be visible
    await electronicsCardLink.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click the link
    await electronicsCardLink.click();

    // Take a screenshot after clicking to verify the action
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_click.png'));

    const extractedData = {
      clickedElementText: await electronicsCardLink.textContent()
    };

    return {
      success: true,
      action: "Navigated to Electronics Category by clicking the 'Shop electronics' link in the category card.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics Category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
